description:
Follows a group of Manchester City fans throughout the 09/10 season in the wake of the takeover by Sheikh Mansour of Abu Dhabi. 

A roller-coaster ride of emotions through Manchester City's exciting 2009/10 season. Following five City fans in their battered bus 'Helios' as they traverse the country hoping for glory, but not expecting it. This film is an exploration of what it means to be a true football fan. A story of passion and undying faith in a club, win, lose or draw. The movie is in turns hilarious, dramatic, moving and uplifting - an exhilarating examination of the power of football to move people
